import React from 'react';
import './overview-page.scss'
import { Dropdown } from 'carbon-components-react';
import {
  Restart20,
} from '@carbon/icons-react';

export default class OverviewPage extends React.Component {


  render() {
    return (
      <div className="bx--grid bx--grid--full-width overview-page">
        <div className="bx--row padded-row">
          <h1 className="overview-page__heading">Analytics overview</h1>
          <div className="lastRefreshed"><Restart20 /></div>
        </div>
        <div className="bx--row padded-row">
          <div className="bx--col-lg-3">
            <p className="mini-header">Choose time period</p>
          </div>
        </div>
      </div>
    );
  }

}
